import React from 'react';
import './NewCollections.css';
import data_product from '../Assets/new_collections'; // Importing the new collections data
import Item from '../Item/Item'; // Using default import

export const NewCollections = () => {
  // Assuming `data_product` contains the new collections data
  const newCollections = data_product;

  // Ensure `newCollections` is defined and is an array before mapping
  if (!newCollections || !Array.isArray(newCollections)) {
    return <div>No new collections available</div>;
  }

  return (
    <div className='new-collections'>
      {newCollections.map((item, i) => (
        <Item key={i} id={item.id} name={item.name} image={item.image} new_price={item.new_price} old_price={item.old_price} />
      ))}
    </div>
  );
};

export default NewCollections;
